"use strict";(self.webpackChunkdocumentation=self.webpackChunkdocumentation||[]).push([[735],{866:e=>{e.exports=JSON.parse('{"tag":{"label":"Testing","permalink":"/obsidian/docs/tags/testing","allTagsPath":"/obsidian/docs/tags","count":4,"items":[{"id":"guides/configurableApplications","title":"Configurable applications","description":"Designing applications to be flexible and configurable makes them more tolerable to changing requirements. The ability to change code frequently and quickly is one of the most important KPIs of any development team. This is generally made possible by a design that facilitates small pull requests, that modify a minimal amount of code across a minimal number of files.","permalink":"/obsidian/docs/guides/configurableApplications"},{"id":"reference/testKit/mockGraphs","title":"mockGraphs","description":"mockGraphs is a function that is used in tests to replace the implementation of graphs with a mock implementation.","permalink":"/obsidian/docs/reference/testKit/mockGraphs"},{"id":"guides/mockDependencies","title":"Mocking dependencies in unit tests","description":"Tests are an integral part of any software project. They let you verify that your code works as expected and that it doesn\'t break when you make changes. We want our tests to be as clear as possible so that developers don\'t have to waste time figuring out what the test is doing our how to fix it when it fails.","permalink":"/obsidian/docs/guides/mockDependencies"},{"id":"reference/testKit/mockModel","title":"mockModel","description":"mockModel is a utility function that allows you to easily mock models.","permalink":"/obsidian/docs/reference/testKit/mockModel"}],"unlisted":false}}')}}]);